#include <bits/stdc++.h>

using namespace std;

int dp[64][64][64];

bool chk(int x1, int y1, int x2, int y2, int x3, int y3) {
	return max(abs(x1 - x2), abs(y1 - y2)) < 2
			|| (x2 == x3 && (x1 != x3 || y1 < min(y2, y3) || max(y2, y3) < y1))
			|| (y2 == y3 && (y1 != y3 || x1 < min(x2, x3) || max(x2, x3) < x1));
}

int main() {
	ios::sync_with_stdio(false);
	cin.tie(nullptr);
	string db = "";
	int p{}, x{}, cnt{};
	for (int k = 0; k < 32; ++k) {
		for (int i = 0; i < 64; ++i) {
			for (int j = 0; j < 64; ++j) {
				if (k % 8 > 3 || k % 8 < k / 8 || i == k || j == k
						|| chk(i / 8, i % 8, j / 8, j % 8, k / 8, k % 8)) {
					continue;
				}
				if (cnt-- == 0) {
					if (isupper(db[p])) {
						cnt = db[p] - 'A';
					} else {
						x = db[p] - 'a', cnt = 0;
					}
					++p;
				}
				dp[i][j][k] = x;
			}
		}
	}
	int T{};
	cin >> T;
	vector<string> A(8);
	while (T--) {
		getline(cin, A[0]);
		for (int i = 0; i < 8; ++i) {
			getline(cin, A[i]);
		}
		int x{}, y{}, z{};
		for (int i = 0; i < 8; ++i) {
			for (int j = 0; j < 8; ++j) {
				if (A[i][j] == 'W') {
					x = 8 * i + j;
				} else if (A[i][j] == 'B') {
					y = 8 * i + j;
				} else if (A[i][j] == 'R') {
					z = 8 * i + j;
				}
			}
		}
		if (z % 8 > 3) {
			x += 7 - x % 8 * 2;
			y += 7 - y % 8 * 2;
			z += 7 - z % 8 * 2;
		}
		if (z / 8 > 3) {
			x += 8 * (7 - x / 8 * 2);
			y += 8 * (7 - y / 8 * 2);
			z += 8 * (7 - z / 8 * 2);
		}
		if (z % 8 < z / 8) {
			x = x % 8 * 8 + x / 8;
			y = y % 8 * 8 + y / 8;
			z = z % 8 * 8 + z / 8;
		}
		cout << dp[x][y][z] << "\n";
	}
	return 0;
}
